  width: 100%;
}
.data-origin-select-container .data-origin-select {
  padding: 4px 12px;
  height: 28px;
  border: 1px solid var(--border-ultrastrong, rgba(0, 0, 0, 0.16));
  cursor: pointer;
}
.data-origin-select-container .data-origin-select:hover {
  background: var(--feedback-hover, rgba(155, 179, 202, 0.06));
}
.data-origin-select-container .data-origin-select-active {
  background: var(--feedback-active, rgba(51, 77, 102, 0.06));
  border: 1px solid #1E6FFF;
}
.data-origin-select-container .data-origin-select-active-without-border {
  background: var(--feedback-active, rgba(51, 77, 102, 0.06));
}
.data-origin-select-container .data-origin-selected-container {
  height: 20px;
  min-height: 20px;
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: space-between;
}
.data-origin-select-container .data-origin-selected-container .data-origin-selected-text {
  height: 16px;
  overflow: hidden;
  white-space: nowrap;
  text-overflow: ellipsis;
  font-size: 12px;
  line-height: 16px;
  color: var(--text-ultrastrong, rgba(0, 0, 0, 0.88));
}
.data-origin-select-container .data-origin-selected-container .data-origin-configs {
  display: flex;
  flex-shrink: 0;
}
.data-origin-select-container .data-origin-selected-container .data-origin-configs > :not(:last-child) {
  margin-right: 8px;
}
.data-origin-select-container .data-origin-selected-container .data-origin-configs .selected-config-text {
  height: 20px;
  padding: 0 4px;
  font-size: 12px;
  line-height: 20px;
  color: var(--text-medium, rgba(0, 0, 0, 0.48));
}
.data-origin-select-container .data-origin-selected-container .data-origin-configs .selected-config-text:hover,
.data-origin-select-container .data-origin-selected-container .data-origin-configs .selected-config-text-active {
  background: var(--feedback-hover, rgba(51, 77, 102, 0.08));
  border-radius: 2px;
}
.data-origin-select-container .data-origin-selected-container .data-origin-configs .more-icon {
  width: 20px;
  height: 20px;
}
.data-origin-select-container .data-origin-selected-container .data-origin-configs .more-icon img {
  width: 20px;
  height: 20px;
}
.data-origin-select-container .data-origin-selected-container .data-origin-configs .more-icon:hover,
.data-origin-select-container .data-origin-selected-container .data-origin-configs .more-icon-active {
  background: var(--feedback-hover, rgba(51, 77, 102, 0.08));
  border-radius: 2px;
}
.data-origin-select-list-container {
  background: #FFFFFF;
}
.data-origin-select-list-container .data-origin-search-input {
  height: 46px;
}
.data-origin-select-list-container .data-origin-search-input input {
  height: 100% !important;
  padding: 0 16px !important;
  font-size: 12px !important;
  line-height: 16px;
}
.data-origin-select-list-container .data-origin-select-list {
  height: calc(100% - 46px);
}
.series-data-settings-container > :not(:last-child) {
  margin-bottom: 8px;
}
.series-data-settings-container .insert-series-container {
  box-sizing: border-box;
  display: inline-flex;
  align-items: center;
  height: 28px;
  padding: 4px 4px 4px 0;
  cursor: pointer;
}
.series-data-settings-container .insert-series-container .insert-icon {
  width: 20px;
  height: 20px;
  margin-right: 4px;
}
.series-data-settings-container .insert-series-container .insert-text {
  font-size: 12px;
  line-height: 16px;
  color: var(--text-medium, rgba(0, 0, 0, 0.48));
}
.series-data-settings-container .insert-series-container:hover {
  background: var(--feedback-hover, rgba(51, 77, 102, 0.06));
  border-radius: 4px;
}
.select-option-container {
  display: flex;
  align-items: center;
}
.select-option-container .select-option-icon {
  width: 20px;
  height: 20px;
  margin-right: 8px;
}
.series-selector {
  border-radius: 4px;
  box-shadow: 0px 0px 0px 1px rgba(0, 0, 0, 0.04), 0px 4px 6px 2px rgba(0, 0, 0, 0.04), 0px 6px 32px 2px rgba(0, 0, 0, 0.16);
  backdrop-filter: blur(8px);
  background: #FFFFFF;
  width: 248px;
}
.series-selector .series-search-input {
  height: 46px;
  padding: 0 16px;
  font-size: 12px;
  line-height: 16px;
  border: 0;
  border-bottom: 1px solid var(--border-weak, rgba(0, 0, 0, 0.04));
}
.series-selector .series-select-list {
  border: 0;
  box-shadow: none;
}
.series-selector .series-select-list-empty {
  font-size: 14px;
  color: var(--text-ultrastrong, rgba(0, 0, 0, 0.88));
  text-align: center;
}
.series-config-menu-item-container {
  width: 120px;
}
#chart-drawer .series-selector-container {
  display: flex;
}
#chart-drawer .series-selector-container .series-selector-title {
  flex: 1;
}
#chart-drawer .series-selector-container .series-add-button {
  width: 24px;
  height: 24px;
}
